const spring = useSpring({
  to: async (next) => {
    await next({ y: y - 50, config: { tension: 80, friction: 12 } });
    await next({ y: y + 20, config: { tension: 120, friction: 18 } });
    await next({ y: y, config: { tension: 90, friction: 15 } });
  },
  from: { y: 0 },
  config: { duration: 1000 },
});
